import React from 'react';

function DoctorsList() {
  // Doctors array with name and placeholder photo for now
  const doctors = [
    { name: "Dr. Christopher Lee", photo: "https://cdn.builder.io/api/v1/image/assets/TEMP/67ab25dfbe84419bbec844be527f71efc68b5c6cc9d3cbba8d5699717b1e9e0a?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82" },
    { name: "Dr. Patrick", photo: "https://cdn.builder.io/api/v1/image/assets/TEMP/67ab25dfbe84419bbec844be527f71efc68b5c6cc9d3cbba8d5699717b1e9e0a?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82" },
    { name: "Dr. Christopher Davis", photo: "https://cdn.builder.io/api/v1/image/assets/TEMP/67ab25dfbe84419bbec844be527f71efc68b5c6cc9d3cbba8d5699717b1e9e0a?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82" },
    { name: "Dr. Richard James", photo: "https://cdn.builder.io/api/v1/image/assets/TEMP/67ab25dfbe84419bbec844be527f71efc68b5c6cc9d3cbba8d5699717b1e9e0a?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82" },
    { name: "Dr. Ben Harvey", photo: "https://cdn.builder.io/api/v1/image/assets/TEMP/67ab25dfbe84419bbec844be527f71efc68b5c6cc9d3cbba8d5699717b1e9e0a?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82" }
  ];

  return (
    <section className="flex flex-col mt-0 bg-white border rounded-lg p-4 w-[500px]">
      <h3 className="sr-only">Doctors List</h3>    
      {/* Header with logo */}
      <div className="flex items-center mb-4">
        <img 
          loading="lazy" 
          src="https://cdn.builder.io/api/v1/image/assets/TEMP/67ab25dfbe84419bbec844be527f71efc68b5c6cc9d3cbba8d5699717b1e9e0a?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82" 
          alt="Doctors Logo"
          className="w-14 h-14 rounded-full mr-4" 
        />
        <h3 className="text-lg font-medium text-gray-900">Doctors</h3>
      </div>

      {/* Doctors list */}
      <ul className="flex flex-col w-full border-t">
        {doctors.map((doctor, index) => (
          <li key={index} className="flex items-center gap-4 py-3 w-full border-b">
            {/* Doctor's image */}
            <img 
              src={doctor.photo}
              alt={doctor.name}
              className="w-10 h-10 rounded-full"
            />
            <div className="flex-auto text-gray-700">{doctor.name}</div>
          </li>
        ))}
      </ul>
    </section>
  );
}

export default DoctorsList;
